    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />

    <link
      rel="stylesheet"

    />
    <link

  </head>
  <body>
    <div class="main-frame">
      <img class="image-23-icon" alt="" src="./public/image-23@2x.png" />

      <header class="image-22-parent">
        <img
          class="image-22-icon"
          loading="eager"
          alt=""
          src="./public/image-22@2x.png"
        />

        <div class="vector-parent">
          <img class="frame-child" alt="" src="./public/rectangle-21.svg" />

          <div class="image-25-wrapper">
            <img
              class="image-25-icon"
              loading="eager"
              alt=""
              src="./public/image-23@2x.png"
            />
          </div>

            <div class="home-wrapper">

              </div>
            </div>
            <div class="feed-wrapper">
              <img class="feed-icon" alt="" src="./public/feed.svg" id="feed" />
            </div>
            <div class="parent-frame">
              <img
                class="contact-icon"
                loading="eager"
                alt=""
                src="./public/contact.svg"
                id="contact"
              />
            </div>
            <div class="parent-frame1">
              <img
                class="explore-icon"
                loading="eager"
                alt=""
                src="./public/explore.svg"
                id="explore"
              />
            </div>
            <div class="vector-nudge-wrapper">
              <img
                class="vector-nudge-icon"
                loading="eager"
                alt=""
                src="./public/vector.svg"
              />
            </div>
            <div class="frame-parent">
              <div class="vector-wrapper">
                <img
                  class="vector-icon"
                  loading="eager"
                  alt=""
                  src="./public/vector-1.svg"
                  id="vector"
                />
              </div>
              <img
                class="vector-icon1"
                loading="eager"
                alt=""
                src="./public/vector-2.svg"
                id="vector1"
              />

              <img
                class="icon-cog"
                loading="eager"
                alt=""
                src="./public/-icon-cog.svg"
                id="iconCog"
              />
            </div>
          </div>
        </div>
      </header>
      <main class="frame-more">
        <section class="search-frame">
          <div class="image-frame">
            <div class="vector-frame">
              <div class="vector-frame-child"></div>
              <div class="text-frame">
                <h3 class="search">SEARCH</h3>
              </div>
              <div class="remove-frame">
                <img
                  class="image-139-icon"
                  loading="eager"
                  alt=""
                  src="./public/image-139@2x.png"
                />

                <img
                  class="image-137-icon"
                  loading="eager"
                  alt=""
                  src="./public/image-137@2x.png"
                />
              </div>
            </div>
          </div>
          <div class="image-116-parent">
            <img
              class="image-116-icon"
              alt=""
              src="./public/image-116@2x.png"
            />

            <img
              class="image-117-icon"
              loading="eager"
              alt=""
              src="./public/image-117@2x.png"
            />
          </div>
          <div class="watch-history-frame">
            <div class="watch-history">Watch History</div>
          </div>
          <div class="frame-with-two-frames">
            <div class="rectangle-parent">
              <div class="frame-item"></div>
              <div class="remove">Remove</div>
            </div>
          </div>
          <div class="image-119-parent">
            <img
              class="image-119-icon"
              alt=""
              src="./public/image-119@2x.png"
            />

            <img
              class="frame-inner"
              loading="eager"
              alt=""
              src="./public/rectangle-136.svg"
              id="rectangle"
            />
          </div>
        </section>
        <section class="frame-with-rectangle-and-remov">
          <div class="more-menu">
            <div class="more-menu-child"></div>
            <div class="remove1">Remove</div>
          </div>
        </section>
        <section class="child-rectangles-wrapper">
          <div class="child-rectangles">
            <div class="more-wrapper">
              <div class="more">
                <div class="more-menu-child"></div>
                <div class="remove2">Remove</div>
              </div>
            </div>
            <div class="more1">more ...</div>
          </div>
        </section>
      </main>
    </div>
